</a>)</li>\n<li>Corre√ß√£o: Problemas com a reprodu√ß√£o autom√°tica de v√≠deos em v√°rios cen√°rios (agradecimentos a <a href=\"https://github.com/JxxIT\" rel=\"nofollow ugc\">@JxxIT</a>, <a href=\"https://github.com/elementor/elementor/issues/24324\" rel=\"nofollow ugc\">#24324</a>, <a href=\"https://github.com/elementor/elementor/issues/14437\" rel=\"nofollow ugc\">#14437</a>, <a href=\"https://github.com/elementor/elementor/issues/7964\" rel=\"nofollow ugc\">#7964</a>)</li>\n<li>Corre√ß√£o: Problemas nas permiss√µes de grava√ß√£o relacionados ao diret√≥rio raiz do WordPress (<a href=\"https://github.com/elementor/elementor/issues/21036\" rel=\"nofollow ugc\">#21036</a>, <a href=\"https://github.com/elementor/elementor/issues/17255\" rel=\"nofollow ugc\">#17255</a>)</li>\n<li>Corre√ß√£o: Restaura√ß√£o de fontes do Google obsoletas que ficaram obsoletas na atualiza√ß√£o anterior (<a href=\"https://github.com/elementor/elementor/issues/27701\" rel=\"nofollow ugc\">#27701</a>)</li>\n<li>Corre√ß√£o: A estrutura de links do Vimeo com hash de privacidade n√£o estava funcionando corretamente com a a√ß√£o de link din√¢mico usando a lightbox</li>\n<li>Corre√ß√£o: Valida√ß√£o das altera√ß√µes no prompt e na tela para permitir a gera√ß√£o no preenchimento generativo da edi√ß√£o de imagem com IA</li>\n<li>Corre√ß√£o: As vers√µes dos arquivos b√°sicos do Elementor estavam sendo adicionadas incorretamente ao hist√≥rico de vers√µes do Elementor Pro</li>\n<li>Corre√ß√£o: O AI Connect n√£o estava sendo iniciado quando o usu√°rio n√£o tinha dados de conex√£o anteriores</li>\n</ul>\n<p><a href=\"https://go.elementor.com/full-changelog/\" rel=\"nofollow ugc\">Consulte o registro de altera√ß√µes para todas as vers√µes.</a></p>\n\";s:11:\"screenshots\";s:3515:\"<ol><li><a href=\"https://ps.w.org/elementor/assets/screenshot-1.gif?rev=3005087\"><img src=\"https://ps.w.org/elementor/assets/screenshot-1.gif?rev=3005087\" alt=\"&lt;strong&gt;Editor visual de arrastar e soltar&lt;/strong&gt