(1, 1, '2024-07-30 14:01:45', '2024-07-30 17:01:45', '<!-- wp:paragraph -->\n<p>Boas-vindas ao WordPress. Esse √© o seu primeiro post. Edite-o ou exclua-o, e ent√£o comece a escrever!</p>\n<!-- /wp:paragraph -->', 'Ol√°, mundo!', '', 'publish', 'open', 'open', '', 'ola-mundo', '', '', '2024-07-30 17:12:17', '2024-07-30 20:12:17', '', 0, 'http://localhost/wordpress/?p=1', 0, 'post', '', 1),
(2, 1, '2024-07-30 14:01:45', '2024-07-30 17:01:45', '<!-- wp:paragraph -->\n<p>Esta √© uma p√°gina de exemplo. √â diferente de um post no blog porque ela permanecer√° em um lugar e aparecer√° na navega√ß√£o do seu site na maioria dos temas. Muitas pessoas come√ßam com uma p√°gina que as apresenta a poss√≠veis visitantes do site. Ela pode dizer algo assim:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Ol√°! Eu sou um mensageiro de bicicleta durante o dia, ator aspirante √† noite, e este √© o meu site. Eu moro em S√£o Paulo, tenho um grande cachorro chamado Rex e gosto de tomar caipirinha (e banhos de chuva).</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...ou alguma coisa assim:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>A Companhia de Miniaturas XYZ foi fundada em 1971, e desde ent√£o tem fornecido miniaturas de qualidade ao p√∫blico. Localizada na cidade de Itu, a XYZ emprega mais de 2.000 pessoas e faz coisas grandiosas para a comunidade da cidade.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>Como um novo usu√°rio do WordPress, voc√™ deveria ir ao <a href=\"http://localhost/wordpress/wp-admin/\">painel</a> para excluir essa p√°gina e criar novas p√°ginas para o seu conte√∫do. Divirta-se!</p>\n<!-- /wp:paragraph -->', 'P√°gina de exemplo', '', 'publish', 'closed', 'open', '', 'pagina-exemplo', '', '', '2024-07-30 14:01:45', '2024-07-30 17:01:45', '', 0, 'http://localhost/wordpress/?page_id=2', 0, 'page', '', 0),
(3, 1, '2024-07-30 14:01:45', '2024-07-30 17:01:45', '<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Quem somos</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>O endere√ßo do nosso site √©: http://localhost/wordpress.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Coment√°rios</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Quando os visitantes deixam coment√°rios no site, coletamos os dados mostrados no formul√°rio de coment√°rios, al√©m do endere√ßo de IP e de dados do navegador do visitante, para auxiliar na detec√ß√£o de spam.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Uma sequ√™ncia anonimizada de caracteres criada a partir do seu e-mail (tamb√©m chamada de hash) poder√° ser enviada para o Gravatar para verificar se voc√™ usa o servi√ßo. A pol√≠tica de privacidade do Gravatar est√° dispon√≠vel aqui: https://automattic.com/privacy/. Depois da aprova√ß√£o do seu coment√°rio, a foto do seu perfil fica vis√≠vel publicamente junto de seu coment√°rio.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">M√≠dia</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Se voc√™ envia imagens para o site, evite enviar as que contenham dados de localiza√ß√£o incorporados (EXIF GPS). Visitantes podem baixar estas imagens do site e extrair delas seus dados de localiza√ß√£o.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Cookies</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Ao deixar um coment√°rio no site, voc√™ poder√° optar por salvar seu nome, e-mail e site nos cookies. Isso visa seu conforto, assim voc√™ n√£o precisar√° preencher seus  dados novamente quando fizer outro coment√°rio. Estes cookies duram um ano.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Se voc√™ tem uma conta e acessa este site, um cookie tempor√°rio ser√° criado para determinar se seu navegador aceita cookies. Ele n√£o cont√©m nenhum dado pessoal e ser√° descartado quando voc√™ fechar seu navegador.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Quando voc√™ acessa sua conta no site, tamb√©m criamos v√°rios cookies para salvar os dados da sua conta e suas escolhas de exibi√ß√£o de tela. Cookies de login s√£o mantidos por dois dias e cookies de op√ß√µes de tela por um ano. Se voc√™ selecionar &quot;Lembrar-me&quot;, seu acesso ser√° mantido por duas semanas. Se voc√™ se desconectar da sua conta, os cookies de login ser√£o removidos.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Se voc√™ editar ou publicar um artigo, um cookie adicional ser√° salvo no seu navegador. Este cookie n√£o inclui nenhum dado pessoal e simplesmente indica o ID do post referente ao artigo que voc√™ acabou de editar. Ele expira depois de 1 dia.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">M√≠dia incorporada de outros sites</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Artigos neste site podem incluir conte√∫do incorporado como, por exemplo, v√≠deos, imagens, artigos, etc. Conte√∫dos incorporados de outros sites se comportam exatamente da mesma forma como se o visitante estivesse visitando o outro site.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Estes sites podem coletar dados sobre voc√™, usar cookies, incorporar rastreamento adicional de terceiros e monitorar sua intera√ß√£o com este conte√∫do incorporado, incluindo sua intera√ß√£o com o conte√∫do incorporado se voc√™ tem uma conta e est√° conectado com o site.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Com quem compartilhamos seus dados</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Se voc√™ solicitar uma redefini√ß√£o de senha, seu endere√ßo de IP ser√° inclu√≠do no e-mail de redefini√ß√£o de senha.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Por quanto tempo mantemos os seus dados</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Se voc√™ deixar um coment√°rio, o coment√°rio e os seus metadados s√£o conservados indefinidamente. Fazemos isso para que seja poss√≠vel reconhecer e aprovar automaticamente qualquer coment√°rio posterior ao inv√©s de ret√™-lo para modera√ß√£o.</p>\n<!-- /wp:paragraph -->\n<!-- wp:paragraph -->\n<p>Para usu√°rios que se registram no nosso site (se houver), tamb√©m guardamos as informa√ß√µes pessoais que fornecem no seu perfil de usu√°rio. Todos os usu√°rios podem ver, editar ou excluir suas informa√ß√µes pessoais a qualquer momento (s√≥ n√£o √© poss√≠vel alterar o seu username). Os administradores de sites tamb√©m podem ver e editar estas informa√ß√µes.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Quais os seus direitos sobre seus dados</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Se voc√™ tiver uma conta neste site ou se tiver deixado coment√°rios, pode solicitar um arquivo exportado dos dados pessoais que mantemos sobre voc√™, inclusive quaisquer dados que nos tenha fornecido. Tamb√©m pode solicitar que removamos qualquer dado pessoal que mantemos sobre voc√™. Isto n√£o inclui nenhuns dados que somos obrigados a manter para prop√≥sitos administrativos, legais ou de seguran√ßa.</p>\n<!-- /wp:paragraph -->\n<!-- wp:heading -->\n<h2 class=\"wp-block-heading\">Para onde seus dados s√£o enviados</h2>\n<!-- /wp:heading -->\n<!-- wp:paragraph -->\n<p><strong class=\"privacy-policy-tutorial\">Texto sugerido: </strong>Coment√°rios de visitantes podem ser marcados por um servi√ßo autom√°tico de detec√ß√£o de spam.</p>\n<!-- /wp:paragraph -->\n', 'Pol√≠tica de privacidade', '', 'draft', 'closed', 'open', '', 'politica-de-privacidade', '', '', '2024-07-30 14:01:45', '2024-07-30 17:01:45', '', 0, 'http://localhost/wordpress/?page_id=3', 0, 'page', '', 0),
