(33, 1, '2024-07-30 14:37:18', '2024-07-30 17:37:18', '<!-- wp:paragraph -->\n<p>A Universidade Federal de Santa Maria (UFSM) tem se destacado n√£o apenas pela qualidade de seu ensino e pesquisa, mas tamb√©m pelo impacto significativo de suas a√ß√µes de extens√£o na comunidade. Recentemente, o projeto \"Sa√∫de e Bem-Estar na Terceira Idade\" tem chamado a aten√ß√£o pela sua abordagem inovadora e pelos resultados positivos alcan√ßados.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Coordenado pela Professora Dr. Ana Maria Silva e pelo Professor Dr. Jo√£o Carlos Pereira, o projeto visa promover a sa√∫de e o bem-estar dos idosos na regi√£o de Santa Maria. Com uma equipe multidisciplinar composta por alunos de diferentes cursos, como Enfermagem, Educa√ß√£o F√≠sica, Psicologia e Nutri√ß√£o, o projeto realiza atividades f√≠sicas adaptadas, palestras educativas sobre alimenta√ß√£o saud√°vel e oficinas de integra√ß√£o social.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A Professora Dr. Ana Maria Silva, do Departamento de Enfermagem, destaca a import√¢ncia de a√ß√µes que valorizem a experi√™ncia de vida dos idosos e proporcionem um ambiente acolhedor para que eles se sintam motivados a participar. J√° o Professor Dr. Jo√£o Carlos Pereira, do Departamento de Educa√ß√£o F√≠sica, enfatiza os benef√≠cios das atividades f√≠sicas regulares na preven√ß√£o de doen√ßas e na melhoria da qualidade de vida.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Al√©m das atividades pr√°ticas, o projeto tamb√©m realiza encontros semanais onde s√£o discutidos temas como o envelhecimento ativo e os direitos dos idosos. Essas discuss√µes s√£o mediadas pela Professora Dr. Carla Mendes, do Departamento de Psicologia, que ressalta a import√¢ncia de oferecer suporte emocional e psicol√≥gico aos participantes.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Os resultados do projeto t√™m sido extremamente positivos, com relatos de melhorias na sa√∫de f√≠sica e mental dos idosos participantes. A UFSM, atrav√©s de suas a√ß√µes de extens√£o, continua a fortalecer seu compromisso com a comunidade, promovendo iniciativas que fazem a diferen√ßa na vida das pessoas.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Para o futuro, a equipe coordenadora planeja expandir o projeto para outras regi√µes e incluir novas atividades, sempre com o objetivo de promover o bem-estar e a qualidade de vida na terceira idade.</p>\n<!-- /wp:paragraph -->', 'Sa√∫de e Bem-Estar na Terceira Idade', '', 'publish', 'open', 'open', '', 'saude-e-bem-estar-na-terceira-idade', '', '', '2024-07-30 14:37:20', '2024-07-30 17:37:20', '', 0, 'http://localhost/wordpress/?p=33', 0, 'post', '', 0),
