(37, 1, '2024-07-30 14:41:05', '2024-07-30 17:41:05', '', '83fe59fc7d92f5fbf68a307b03a72af2', '', 'inherit', 'open', 'closed', '', '83fe59fc7d92f5fbf68a307b03a72af2', '', '', '2024-07-30 14:41:05', '2024-07-30 17:41:05', '', 19, 'http://localhost/wordpress/wp-content/uploads/2024/07/83fe59fc7d92f5fbf68a307b03a72af2-1.png', 0, 'attachment', 'image/png', 0),
(78, 1, '2024-07-30 15:09:13', '2024-07-30 18:09:13', '<!-- wp:paragraph -->\n<p>A Universidade Federal de Santa Maria (UFSM) tem demonstrado seu compromisso com a sustentabilidade e o meio ambiente atrav√©s de diversas a√ß√µes de extens√£o voltadas para a reciclagem e a conscientiza√ß√£o ambiental. Um exemplo not√°vel √© o projeto \"Reciclar para Preservar\", que tem se tornado um modelo de boas pr√°ticas na regi√£o.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Coordenado pelo Professor Dr. Ricardo Oliveira e pela Professora Dr. Mariana Ferreira, o projeto tem como objetivo principal promover a coleta seletiva e o correto descarte de res√≠duos na universidade e em comunidades pr√≥ximas. Com a participa√ß√£o ativa de alunos de diversos cursos, como Engenharia Ambiental, Biologia, e Administra√ß√£o, o projeto realiza campanhas educativas, palestras, e oficinas pr√°ticas sobre reciclagem e sustentabilidade.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O Professor Dr. Ricardo Oliveira, do Departamento de Engenharia Ambiental, explica que a conscientiza√ß√£o √© a chave para mudan√ßas duradouras. \"N√£o basta apenas oferecer locais de coleta, √© preciso educar a comunidade sobre a import√¢ncia de separar corretamente os res√≠duos e o impacto positivo dessa a√ß√£o no meio ambiente\", afirma.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>J√° a Professora Dr. Mariana Ferreira, do Departamento de Biologia, destaca as oficinas pr√°ticas realizadas com a comunidade. \"Nas oficinas, mostramos na pr√°tica como separar o lixo, quais materiais s√£o recicl√°veis e como reutilizar objetos do dia a dia. Essas atividades t√™m um grande impacto, especialmente nas escolas, onde as crian√ßas se tornam multiplicadoras do conhecimento\", ressalta.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O projeto \"Reciclar para Preservar\" tamb√©m conta com a parceria de empresas locais de reciclagem, o que garante que os res√≠duos coletados tenham o destino correto. Al√©m disso, o projeto promove a integra√ß√£o de catadores de materiais recicl√°veis, valorizando seu trabalho e proporcionando melhores condi√ß√µes de atua√ß√£o.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Os resultados t√™m sido extremamente positivos. A UFSM j√° registra uma redu√ß√£o significativa na quantidade de res√≠duos destinados ao aterro sanit√°rio e um aumento na quantidade de materiais reciclados. A comunidade universit√°ria e local tem se mostrado cada vez mais engajada e consciente da import√¢ncia da reciclagem.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Para o futuro, a equipe coordenadora planeja expandir o projeto para outras √°reas da cidade e incluir novas a√ß√µes, como a compostagem de res√≠duos org√¢nicos e a promo√ß√£o de pr√°ticas de consumo consciente. A UFSM, atrav√©s de suas a√ß√µes de extens√£o, continua a fortalecer seu compromisso com a sustentabilidade, contribuindo para um ambiente mais limpo e saud√°vel para todos.</p>\n<!-- /wp:paragraph -->', 'Reciclar para Preservar', '', 'publish', 'open', 'open', '', 'reciclar-para-preservar', '', '', '2024-07-30 15:09:38', '2024-07-30 18:09:38', '', 0, 'http://localhost/wordpress/?p=78', 0, 'post', '', 0),
