(82, 1, '2024-07-30 15:12:19', '2024-07-30 18:12:19', '<!-- wp:paragraph -->\n<p>A Universidade Federal de Santa Maria (UFSM) est√° ativamente engajada em iniciativas que promovem o bem-estar animal, evidenciando seu compromisso com a responsabilidade social e ambiental. Um dos projetos de destaque √© o \"Cuidando de Patinhas\", que tem como foco o cuidado e a reabilita√ß√£o de animais abandonados ou de rua na regi√£o.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sob a coordena√ß√£o da Professora Dr. Patr√≠cia Souza e do Professor Dr. Marcos Lima, o projeto re√∫ne uma equipe dedicada de alunos dos cursos de Medicina Veterin√°ria, Zootecnia, e Biologia. Juntos, eles trabalham incansavelmente para resgatar, tratar e encontrar lares para animais em situa√ß√£o de abandono.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A Professora Dr. Patr√≠cia Souza, do Departamento de Medicina Veterin√°ria, destaca a import√¢ncia da conscientiza√ß√£o e educa√ß√£o da comunidade sobre o abandono e maus-tratos de animais. \"Nossa miss√£o vai al√©m do resgate. Queremos sensibilizar as pessoas sobre a responsabilidade de ter um animal de estima√ß√£o e promover a ado√ß√£o respons√°vel\", afirma.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O Professor Dr. Marcos Lima, do Departamento de Zootecnia, enfatiza a import√¢ncia do cuidado adequado e da reabilita√ß√£o dos animais resgatados. \"Oferecemos tratamento veterin√°rio completo, incluindo vacina√ß√£o, castra√ß√£o e cuidados nutricionais. Tamb√©m trabalhamos na socializa√ß√£o desses animais, preparando-os para uma nova vida em um lar amoroso\", explica.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>O projeto \"Cuidando de Patinhas\" tamb√©m promove campanhas de ado√ß√£o e eventos de conscientiza√ß√£o, onde a comunidade √© convidada a conhecer os animais e aprender mais sobre a import√¢ncia do cuidado respons√°vel. Al√©m disso, o projeto estabelece parcerias com ONGs e protetores independentes para ampliar o alcance de suas a√ß√µes.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Os resultados t√™m sido inspiradores. Desde o in√≠cio do projeto, centenas de animais foram resgatados, tratados e encaminhados para novos lares. A UFSM tem se tornado um ponto de refer√™ncia na regi√£o para quest√µes relacionadas ao bem-estar animal, contando com o apoio e o engajamento crescente da comunidade.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Para o futuro, a equipe coordenadora pretende expandir as atividades do projeto, incluindo a constru√ß√£o de um abrigo maior e a cria√ß√£o de programas de educa√ß√£o continuada sobre cuidados animais nas escolas locais. A UFSM, atrav√©s do projeto \"Cuidando de Patinhas\", reafirma seu compromisso com a prote√ß√£o e o cuidado dos animais, promovendo uma cultura de respeito e compaix√£o na sociedade.</p>\n<!-- /wp:paragraph -->', 'Cuidando de Patinhas', '', 'publish', 'open', 'open', '', 'cuidando-de-patinhas', '', '', '2024-07-30 15:12:21', '2024-07-30 18:12:21', '', 0, 'http://localhost/wordpress/?p=82', 0, 'post', '', 0),
